static void ms_font_draw_char(m2d_context* ctx, char c, int x, int y, uint32_t color) {
    if (c < 32 || c > 126) return;

    const unsigned char* bitmap = MS_BITMAP_FONT[(int)c];
    
    // Extract the R, G, B components of the target color
    uint32_t r = (color >> 16) & 0xFF;
    uint32_t g = (color >> 8) & 0xFF;
    uint32_t b = color & 0xFF;

    int i = 0;
    for (int row = 0; row < 36; row++) {
        for (int col = 0; col < 10; col += 2) {
            // Unpack the two 4-bit alpha values from the byte
            unsigned char packed_byte = bitmap[i++];
            int alpha1 = packed_byte >> 4; // Alpha for the left pixel
            int alpha2 = packed_byte & 0x0F; // Alpha for the right pixel

            // Blend and draw the first pixel if needed
            if (alpha1 > 0) {
                uint32_t blended_r = (r * alpha1) / 15;
                uint32_t blended_g = (g * alpha1) / 15;
                uint32_t blended_b = (b * alpha1) / 15;
                uint32_t blended_color = (blended_r << 16) | (blended_g << 8) | blended_b;

                m2d_draw_pixel(ctx, x + col, y + row, blended_color);
            }

            // Blend and draw the second pixel if needed
            if (alpha2 > 0) {
                uint32_t blended_r = (r * alpha2) / 15;
                uint32_t blended_g = (g * alpha2) / 15;
                uint32_t blended_b = (b * alpha2) / 15;
                uint32_t blended_color = (blended_r << 16) | (blended_g << 8) | blended_b;

                m2d_draw_pixel(ctx, x + col + 1, y + row, blended_color);
            }
        }
    }
}

static void ms_font_draw_string(m2d_context* ctx, const char* text, int x, int y, uint32_t color) {
    int start_x = x;

    while (*text) {
        ms_font_draw_char(ctx, *text, start_x, y, color);
        start_x += 10;
        text++;
    }
}

